      "staticListenersJson": {
       "type": "string"
      },
      "statsBindAddr": {
       "type": "string"
      },
      "statsConfigJson": {
       "type": "string"
      },
      "statsFlushInterval": {
       "type": "string"
      },
      "statsSinksJson": {
       "type": "string"
      },
